import React from 'react';
import { Link } from 'react-router-dom';
import NavItem from './NavItem.jsx';
import '../../styles/navbar.sass';
import '../../styles/logout-button.sass';
import LogoutButton from './LogoutButton.jsx';
import OverviewIcon from '../../assets/icons/Menu/Overview.png';
import BalancesIcon from '../../assets/icons/Menu/wallet.png';
import BillsIcon from '../../assets/icons/Menu/Bill.png';
import ExpencesIcon from '../../assets/icons/Menu/Expencces.png';
import GoalsIcon from '../../assets/icons/Menu/Goal.png';
import SettingIcon from '../../assets/icons/Menu/Settings.png';
import LogoutIcon from '../../assets/icons/Menu/Frame 39997.png';

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="navbar-main">
                <Link className="navbar-brand" to="/">BudgetBuddy</Link>
                <ul className="navbar-nav">
                    <NavItem to="/overview" icon={<svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
<path d="M21 14H14V21H21V14Z" stroke="white" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
<path d="M10 14H3V21H10V14Z" stroke="white" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
<path d="M21 3H14V10H21V3Z" stroke="white" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
<path d="M10 3H3V10H10V3Z" stroke="white" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
</svg>}>Overview</NavItem>
                    <NavItem to="/balances" icon={BalancesIcon}>Balances</NavItem>
                    <NavItem to="/bills" icon={BillsIcon}>Bills</NavItem>
                    <NavItem to="/expenses" icon={ExpencesIcon}>Expenses</NavItem>
                    <NavItem to="/goals" icon={GoalsIcon}>Goals</NavItem>
                    <NavItem to="/settings" icon={SettingIcon}>Settings</NavItem>
                </ul>
            </div>
            <div className="navbar-footer">
                <LogoutButton logo={LogoutIcon} />
                <div className="user-profile">
                    <Link to="/settings">Tanzir Rahman</Link>
                    <small>View profile</small>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
